Let's have a chat.

How was your day today? Did you smile or were your tired, cranky, and snippy?

Did you play with your children or were you too concerned with the laundry and dishes?

Were you physically present with those little ones or was your nose buried in your phone on Facebook? 

Did you make messes with your kids or were you too busy following behind them and cleaning those messes up?

I hate to admit it, Mama, but this was me today...and yesterday...and probably the day before that.

But now wait a minute Mama, stop and take a look up. See that? That's the site of your children playing together and being little.

Look at that Mama! You made them, isn't that pretty cool?! 

Soak that up Mama because one day they'll fight. One day they'll have separate interests and will play in their separate rooms. One day, they'll be grown and gone and you'll cry because it went by too fast. One day, this season will be no more and you won't get it back.

Cast aside that laundry and those dishes, Mama. Put the phone away and put a smile on that beautiful face. Enjoy those gifts God gave you and admire your work. Go soak up this beautiful season of motherhood while you can. 

XOXO,

Courtney

